My Wife\'s Hot Friend - Brandy Aniston 

May 3, 2011 

Brandy invites her friend\'s husband Alec over to her home to ask him if she could use their horses for a photo shoot. Alec says it\'s OK by him, but she\'d have to wait until the weekend when his wife returns from out of town so she can show Brandy how to ride properly. It\'s then that Brandy admits that she had an ulterior motive in inviting him over while his wife is gone. Out come her tits, and she shows Alec that she already knows how to ride properly...
